      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN + CAST ( col2 AS INTEGER ) * col1 * + col2 + + col0 + 35 * - ( + col2 ) AND col0;
  - name: tab1

outputs:
  - name: q5465.out
    data: |
